  margin-top: 50px;
`;

export function Comment(props) {
  const { index } = useParams();
  console.log(index);
  return (
    <CommentComponent>
      <CommentInputContainer index={index} />
      <CommentOutputContainer index={index} />
    </CommentComponent>
  );
}
